import Link from 'next/link';
import fetch from 'isomorphic-unfetch';

const Index = props => (
    <div>
<meta httpEquiv="Access-Control-Allow-Origin" content="*"></meta>
        <Link href="/about">
            <a>About Page</a>
        </Link>
        <p>{JSON.stringify(props.CHOICES[0])}</p>
    </div>
);

Index.getInitialProps = async function () {
    const res = await fetch('https://dy-api.com/v2/serve/user/choose', {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json',
            "DY-API-Key": "efa09b8c005ea63ffc3060d04ef7f79d3d5135d2a8d05df33598d8e54d01dadd"
        },
        body: JSON.stringify({
            "user":{
            "dyid":"8552335913049288897",
            "dyid_server":"8552335913049288897"
            },
            "session":{
                "dy":"v8t6mxr5w0hrligm6rlb2w9i005ipmmq"
            },
            "selector": { "names": ["recs"] },
            "context": {
                "page": {
                    "type": "OTHER",
                    "data": [],
                    "location": "www.example.com",
                    "locale": "en_US"
                }
            }
        })
    }).then(r => {
        return r;
    })


    const data = await res.json();

    return {
        data
    };
};

export default Index;
